import React, { FC } from "react";
import { Button, Dialog, IconButton, Typography } from "@material-ui/core";
import {
  createStyles,
  Theme,
  withStyles,
  WithStyles,
  makeStyles
} from "@material-ui/core/styles";
import MuiDialogTitle from "@material-ui/core/DialogTitle";
import MuiDialogContent from "@material-ui/core/DialogContent";
import MuiDialogActions from "@material-ui/core/DialogActions";
import CloseIcon from "@material-ui/icons/Close";

import TextField from '@material-ui/core/TextField';

debugger;

const styles = (theme) =>
  createStyles({
    root: {
      margin: 0,
      padding: theme.spacing(2)
    },
    closeButton: {
      position: "absolute",
      right: theme.spacing(1),
      top: theme.spacing(1),
      color: theme.palette.grey[500]
    }
  });


const DialogTitle = withStyles(styles)((props) => {
  const { children, classes, onClose, ...other } = props;
  return (
    <MuiDialogTitle disableTypography className={classes.root} {...other}>
      <Typography variant="h6">{children}</Typography>
      {onClose && (
        <IconButton
          aria-label="close"
          data-testid="close-modal"
          className={classes.closeButton}
          onClick={onClose}
        >
          <CloseIcon />
        </IconButton>
      )}
    </MuiDialogTitle>
  );
});

const DialogContent = withStyles((theme) => ({
  root: {
    padding: theme.spacing(2)
  }
}))(MuiDialogContent);

const DialogActions = withStyles((theme) => ({
  root: {
    margin: 0,
    padding: theme.spacing(1)
  }
}))(MuiDialogActions);

const useFormModalStyles = makeStyles((theme) =>
  createStyles({
    root: {
      "& .MuiTextField-root": {
        margin: theme.spacing(1)
      }
    }
  })
);

const str="Aish";

const [inputVal, setInputVal] = ("ABCDE");

const changeVal = (e) => {
  console.log(e);
  setInputVal(e.target.value)
}

const onSubmit1 = (e) => {
  console.log("submit");
  console.log("aISHWARYA Isha",e);
  // onCloseModal();
};

export const FormModal = ({
  title,
  onSubmit,
  onCloseModal,
  maxWidth,
  isOpen = true,
  children,
  cancelButton,
  register,
}) => {
  return (
    <Dialog
      onClose={onCloseModal}
      aria-labelledby="customized-dialog-title"
      open={isOpen}
      fullWidth
      maxWidth={maxWidth}
      data-testid="form-modal"
    >
      {/* <form> */}
        <DialogTitle id="form-dialog-title" onClose={onCloseModal}>
          {title}
        </DialogTitle>
        <DialogContent dividers>
          {/* <TextField {...register('value_name')} label="Title" name="title" fullWidth /> */}
      <TextField
        //id="outlined-multiline-static"
       // label="Description"
        //{...register('value_name')}
        //name="description"
        //fullWidth
       // multiline
        //rows={3}
        variant="outlined"
        value={inputVal}
      onChange={e => changeVal(e) }
      label={inputVal}
      /></DialogContent>
        <DialogActions>
          {cancelButton && (
            <Button
              onClick={onCloseModal}
              color="secondary"
              data-testid="cancel-button"
            >
              Cancel
            </Button>
          )}
          <Button
            //type="submit"
            autoFocus
            color="primary"
            data-testid="submit-button"
            onClick={(e) => onSubmit1(e)}
          >
            Save changes
          </Button>
        </DialogActions>
      {/* </form> */}
    </Dialog>
  );
};
